import React from 'react';
import './Input.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import Media from 'react-media';
import { useForm } from 'react-hook-form';
import { useNavigate } from 'react-router-dom';


// Input Field form
export default function REturnInPut() {
 return (
  <Media
   queries={{
    small: '(max-width: 599px)',
    medium: '(min-width: 600px) and (max-width:1199px)',
    large: '(min-width: 1200px)',
   }}>
   {matches => (
    <>
     {matches.small && <ScreenSmall />}
     {matches.medium && <ScreenLarge />}
     {matches.large && <ScreenLarge />}
    </>
   )}
  </Media>
 );
};

export const ScreenLarge = () => (
 <div className='form-input-sign-admin'>
  <FormDataInput />
 </div>
);
export const ScreenSmall = () => (
 <div className='form-input-sign-admin-sm'>
  <FormDataInput />
 </div>
);
export const FormDataInput = () => {

 const { register, handleSubmit, reset } = useForm();
 const navigation = useNavigate();

 const onSubmit = async data => {
  console.log(data);
  reset();
 };
 return (
  <form onSubmit={handleSubmit(onSubmit)}>

   <input type='email' id='email' placeholder='email admin' name='email' {...register('email', { required: true })} />
   <button className='Btn' >Suivant</button>

  </form>
 );
};
